import React from 'react';

import {StyleSheet, css} from 'aphrodite';
// import './index.css';

import shiro from './images/shiro.png';
import akame from './images/akame.png';

export default class Menu extends React.Component{
    constructor(props){
        super(props);

        this.state = {deltay: 0};
    }

    componentDidMount(){
        this.timerID = setInterval(() => this.update(), 100);
    }

    componentWillUnmount(){
        clearInterval(this.timerID);
    }

    update(){
        console.log((window.pageYOffset !== undefined) ? window.pageYOffset : (document.documentElement || document.body.parentNode || document.body).scrollTop);
        this.setState({deltay: (window.pageYOffset !== undefined) ? window.pageYOffset : (document.documentElement || document.body.parentNode || document.body).scrollTop});
    }

    render(){
        return (
            <div className={css(style.container)}>
                <div className={css(style.titleContainer)}>
                    <h1 className={css(style.titleText, style.titleGradient)}>React Sandbox</h1>
                </div>
                <div>
                    <img src={shiro} alt='shiro' className={css(style.titleImage)}/>
                    {/* <div class='shadow'></div> */}
                </div>
                <h1 className={css(style.titleText, style.titleGradient)} id="origin">-</h1>
                <div className={css(style.buttonContainer)}>
                    <button className={css(style.buttonElement)} onClick={() => this.props.handleDisplayChange(1)}>
                        <div className={css(style.buttonImage)}>
                            <div className={css(mxjLogo.a)}>
                                <p className={css(mxjLogo.b)}></p>
                                <p className={css(mxjLogo.b)}></p>
                                <p className={css(mxjLogo.b)}></p>
                                <p className={css(mxjLogo.b)}></p>
                                <p className={css(mxjLogo.b)}></p>
                                <p className={css(mxjLogo.b)}></p>
                                <p className={css(mxjLogo.b)}></p>
                                <p className={css(mxjLogo.b)}></p>
                                <p className={css(mxjLogo.b)}></p>
                                <p className={css(mxjLogo.b)}></p>
                                <p className={css(mxjLogo.b)}></p>
                                <p className={css(mxjLogo.b)}></p>
                            </div>
                        </div>
                        <h1 className={css(style.buttonTitle)}>M by J</h1>
                    </button>
                    <button className={css(style.buttonElement)} onClick={() => this.props.handleDisplayChange(1)}>
                        <img src={akame} className={css(style.buttonImage)}/>
                        <h1 className={css(style.buttonTitle)}>test</h1>
                    </button>
                    <button className={css(style.buttonElement)} onClick={() => this.props.handleDisplayChange(1)}>
                        <img src={akame} className={css(style.buttonImage)}/>
                        <h1 className={css(style.buttonTitle)}>test</h1>
                    </button>
                </div>
                <div className={css(style.topFade)}></div>
            </div>
        )
    }
}

const style = StyleSheet.create({
    container: {
        backgroundColor: "#E7CFEA",
        position: 'relative'
    },

    titleContainer:{
        width:700,
        height:'fit-content',
        margin:'auto',
        paddingTop:100
    },

    titleText:{
        fontSize: 150,
        textAlign: 'center',
        margin:'auto',
    },

    titleGradient:{
        backgroundImage: 'linear-gradient(45deg, #efe633, #998CD9)',
        backgroundClip: 'text',
        color:'rgba(0,0,0,0)',

        zIndex: 3
    },

    titleImage:{
        width: '500px',
        height: '500px',
        
        display: 'block',

        margin:'auto',
        paddingTop:300,
        paddingBottom:300
    },

    buttonContainer:{
        width:800,
        height:'fit-content',
        paddingTop:30,
        paddingBottom:30,
        margin:'auto',
        marginTop:120,
        
        borderRadius:150,

        display: 'grid',
        gridTemplateColumns: 'auto',

        backgroundColor: '#D1A6D8'
    },

    buttonElement:{
        width:600,
        height:150,

        margin:'auto',
        marginTop:20,
        marginBottom:20,

        display:'flex',
        justifyContent:'space-evenly',
        alignItems:'center',

        border:'0px',
        borderRadius:50
    },

    buttonImage:{
        width:100,
        height:100,

        opacity:'70%',

        borderRadius:30,

        backgroundColor:'white',

        objectFit:'cover'
    },

    buttonTitle:{
        width:'fit-content',
        
        fontSize:50,

        color:"#e7c8eb"
    },

    topFade:{
        height:400,
        width:'100%',
        top:0,
        position:'fixed',

        zIndex:2,

        backgroundImage: 'linear-gradient(180deg, rgba(231, 207, 234, 100), rgba(231, 207, 234, 0))'
    }
});

const mxjLogo = StyleSheet.create({
    a:{
        display:'grid',
        position:'absolute',

        border: '2px solid black',

        transform:'translate(10px,10px)',

        width:70,
        height:52,

        gridTemplateColumns:'auto auto auto auto',
        gridTemplateRows:'auto auto auto',

        columnGap:2,
        rowGap:2,

        backgroundColor:'black'
    },
    b:{
        width:16,
        height:16,

        margin:0,

        backgroundColor:'red'
    }
})
